import React from "react";
import { Router } from "@reach/router";
import Header from "./elements/Header";
import Home from "./Home";
import { GlobalStyle } from "./styles/GlobalStyle";

const App = () => (
  <>
    <Header />
    <Router>
      <Home path="/" />
    </Router>

    <GlobalStyle />
  </>
);

export default App;
